import React from 'react'

function FileList(props) {
  const post = props.post;
  return (
    <div>
      <ul>
        {post?.map(post => <li>{post.symbol} {post.priceChange}{post.priceChangePercent}</li>)}
      </ul>
    </div>
  )
}

export default FileList
